import Textfield from "@atlaskit/textfield";
import Button from "@atlaskit/button";

function App() {
  return (
    <>
    <h3>Things need to be done</h3>
    <Textfield 
      name="add-todo"
      placeholder="Input..." 
      elemAfterInput={
        <Button isDisabled={true} appearance={"primary"}>
          Add
        </Button>
    }
    css ={{ padding: "2px 4px 2px"}}
    ></Textfield>
    </>




  );
}

export default App;
